import { AssetManager, Screen, Viewport } from "gdxts";

export const createGameScreen = async (
  assetManager: AssetManager,
  viewport: Viewport
): Promise<Screen> => {
  return {
    update(delta: number) {},
    dispose(): void {},
  };
};
